Combined with Codeware , you can e.g. quickly create atmosphere like so: &nbsp;&nbsp;Redscript let weather = GameInstance.GetWeatherSystem(game);
weather.SetWeather(n"24h_weather_rain", 20.0, 9u);
GameInstance.GetAudioSystemExt(game).Play(n"milles_feuilles"); YouTube demo

