Since version 1.4.1+ audio emitters are now affected by reverb mix , and optionally by environmental preset . These can be opted-in/out by defining on EmitterSettings: &nbsp;&nbsp;Redscript let settings = new EmitterSettings();
settings.affectedByReverbMix = false;
settings.affectedByEnvironmentalPreset = false; Youtube demo
